import React from 'react';
import { Link } from 'react-router-dom';
import ContractForm from '../components/ContractForm';
import Footer from '../components/Footer';
import '../styles/form.css';

function Form() {
  return (
    <div>
      <form>
        <ContractForm />
      </form>
      <Link to="/">
        <button type="button">
          ENVIAR
        </button>
      </Link>
      <footer>
        <Footer />
      </footer>
    </div>
  );
}

export default Form;
